import axios from "axios"


const Logout = ({username}) => {

    const onClick = () => {
        return (
            axios.post('https://grocerease.herokuapp.com/auth/token/logout/', {
                username: username,
                // email: email,
            }
        ))
    }

    return (
        <button>Logout</button>
    )
}

export default Logout;
